import { BrowserRouter as Router, Route }from 'react-router-dom';

function Teoria() {
  return (
    <Router>
      <div>
        <Route path='/Teoria' exact component={Teoria}>
          <div id='SBA'> 
          <div className='titulo sba'> Teoria da Capo <br /><br /> </div>
            <div className='SobreAulas'>
              As aulas são de 50 minutos a 1 hora de duração. Aula individual <br />
              é dada com professor e Aluno, a em grupo pode chegar até 3 alunos <br />
              as aulas somente práticas são focadas no como tocar o instrumento em <br />
              especifico (posicionamento da mão etc), e as aulas teóricas ajudam <br />
              o aluno compreender a música como um todo, existe um limite que o <br />
              aluno pode chegar sem a teoria
            </div>
          </div>
        </Route>
      </div>
    </Router>
  );
}

export default Teoria;
